import React, { Component } from "react";
import Pnav from "../Projects";

export default class Grimeton extends Component {
  render() {
    return (
      <div>
        <Pnav />
        <img className="Grimbild" src={require("./Grimeton/1.png")} />
        <img className="Grimbild" src={require("./Grimeton/2.png")} />
        <img className="Grimbild" src={require("./Grimeton/3.png")} />
        <img className="Grimbild" src={require("./Grimeton/4.png")} />
        <img className="Grimbild" src={require("./Grimeton/5.png")} />
        <img className="Grimbild" src={require("./Grimeton/6.png")} />
      </div>
    );
  }
}
